import React, { Component } from "react";
import axios from 'axios';
import "./infobar.css";

class Infobar extends Component{
    constructor(prop){
        super(prop);
        this.state = {
            coin: []
        };
    }

    componentDidMount(){
        let config = {'Authorization': '776194b8-0b73-4227-9b92-cc67fbed4dcf'};
        axios.get('https://pro-api.coinmarketcap.com/v1/cryptocurrency/info', {headers: config})
            .then(response => {
                console.log(response);
                this.setState({
                    coin: response.data[0]
                })
            }).c;
    }

    render(){

        let storing = this.state.coin.rank;
        return(
            <div>
            {storing}
            <p>Hello</p>
            </div>
        )
    }
}

export default Infobar;
